<br>
<br>モッズコートらしい深緑のオリーブグリーンカラー。
<br>裏地にはユニオンジャック柄を採用。
<br>モッズコートといえども、決して重たくなく
<br>動きやすく、多シーズンお使いいただけます。
<br>着脱はボタンとジップの2重構造。
<br>ジップは様々な着こなしができるよう
<br>ダブルジップとなっており、
<br>遊び心のある作りとなっているのも魅力的です。
<br>
<br>左腕のワッペンロゴやフードを絞れる紐、
<br>首元まで温かなマジックテープ仕様など
<br>ベンシャーマンならではのこだわりを感じる一品です。
